status_message:
The Telkom Knockout quarterfinals get underway next weekend. 

Free State Stars vs Kaizer Chiefs; 
Orlando Pirates vs Golden Arrows; 
SuperSport United vs Moroka Swallows; 
Platinum Stars vs Mamelodi Sundowns
            
Who will progress to the semifinals?

NEDBANK CUP FIXTURES

22 February: 

Mbombela United v Vasco Da Gama/Santos (Kanyamazane Stadium, 8pm); 
Ajax Cape Town v Mamelodi Sundowns (Cape Town Stadium, 8pm)

23 February:
Maluti FET College v Orlando Pirates (Charles Mopeli Stadium, 3pm); 
United FC/Roses United v Chippa United (Moruleng/Botshabelo Stadium, 3pm); 
SuperSport United v Moroka Swallows (Peter Mokaba Stadium, 6pm); 
Bidvest Wits v Kaizer Chiefs (Mbombela Stadium, 8.15pm); 
Vardos v Golden Arrows (Makhulong Stadium, 8.15pm); 
University of Pretoria v Maritzburg United (TUKS Stadium, 8.15pm)

24 February: 
Island FC v Polokwane City/FC AK (Ulundi Stadium, 2pm); 
Free State Stars v Witbank Spurs/Blackburn Rovers (Goble Park Stadium, 3pm); 
Bloemfontein Celtic v Milano United/Thanda Royal Zulu (Free State Stadium, 3pm);
Dynamos/MP Black Aces v Platinum Stars (Giyani/Themba Senamela Stadium, 3pm); 
Magesi FC v Jomo Cosmos/FC Cape Town (Old Peter Mokaba Stadium, 3pm)

27 February: 
AmaZulu FC v Tembu Royals (King Zwelithini Stadium, 7.30pm); 
Black Leopards v Cape Town All Stars (Peter Mokaba Stadium, 7.30pm); 
Sivutsa Stars/African Warriors v Jacksa Spears (Kanyamazane/Charles Mopeli Stadium, 7.30pm)

